import React, { useState, useEffect } from 'react';
import { 
  BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, 
  PieChart, Pie, Cell, 
  LineChart, Line, 
  ResponsiveContainer 
} from 'recharts';
import './App.css';

function ExploratoryDataAnalysisPage() {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [dataOverview, setDataOverview] = useState(null);

  // Sample data for visualizations
  const featureDistributionData = [
    { feature: 'Age', count: 35, min: 25, max: 55 },
    { feature: 'Income', count: 28, min: 30000, max: 120000 },
    { feature: 'Experience', count: 22, min: 1, max: 20 },
    { feature: 'Family', count: 15, min: 1, max: 4 }
  ];

  const targetDistributionData = [
    { name: 'Approved', value: 3750 },
    { name: 'Rejected', value: 1250 }
  ];

  const COLORS = ['#0088FE', '#FF8042'];

  const correlationData = [
    { feature: 'Age', correlation: 0.35 },
    { feature: 'Income', correlation: 0.62 },
    { feature: 'Experience', correlation: 0.45 },
    { feature: 'Family', correlation: -0.12 }
  ];

  useEffect(() => {
    // Existing mock fetch logic
    const timer = setTimeout(() => {
      setDataOverview({
        total_records: 5000,
        features: 12,
        target_distribution: {
          approved: 3750,
          rejected: 1250
        },
        missing_values: "None",
        data_types: {
          numerical: ["Age", "Experience", "Income", "ZIP Code", "Family", "CCAvg", "Mortgage"],
          categorical: ["Education", "Securities Account", "CD Account", "Online", "CreditCard"]
        }
      });
      setLoading(false);
    }, 1000);

    return () => clearTimeout(timer);
  }, []);

  if (loading) {
    return (
      <div className="page-container">
        <h1>Exploratory Data Analysis</h1>
        <div className="loading-indicator">Loading data analysis...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="page-container">
        <h1>Exploratory Data Analysis</h1>
        <div className="error-message">Error loading data: {error}</div>
      </div>
    );
  }

  return (
    <div className="page-container">
      <h1>Exploratory Data Analysis</h1>
      
      <div className="eda-container">
        {/* Previous sections remain the same */}
        
        <section className="eda-section">
          <h2>Data Visualizations</h2>
          <div className="visualizations-container">
            {/* Target Distribution Pie Chart */}
            <div className="visualization-card">
              <h3>Target Distribution</h3>
              <ResponsiveContainer width="100%" height={300}>
                <PieChart>
                  <Pie
                    data={targetDistributionData}
                    cx="50%"
                    cy="50%"
                    labelLine={false}
                    outerRadius={80}
                    fill="#8884d8"
                    dataKey="value"
                    label={({ name, percent }) => `${name} ${(percent * 100).toFixed(0)}%`}
                  >
                    {targetDistributionData.map((entry, index) => (
                      <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                    ))}
                  </Pie>
                  <Tooltip />
                  <Legend />
                </PieChart>
              </ResponsiveContainer>
            </div>

            {/* Feature Distribution Bar Chart */}
            <div className="visualization-card">
              <h3>Feature Distribution</h3>
              <ResponsiveContainer width="100%" height={300}>
                <BarChart data={featureDistributionData}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="feature" />
                  <YAxis />
                  <Tooltip />
                  <Legend />
                  <Bar dataKey="count" fill="#8884d8" />
                </BarChart>
              </ResponsiveContainer>
            </div>

            {/* Feature Correlation Line Chart */}
            <div className="visualization-card">
              <h3>Feature Correlation Strength</h3>
              <ResponsiveContainer width="100%" height={300}>
                <LineChart data={correlationData}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="feature" />
                  <YAxis domain={[-1, 1]} />
                  <Tooltip />
                  <Legend />
                  <Line type="monotone" dataKey="correlation" stroke="#8884d8" />
                </LineChart>
              </ResponsiveContainer>
            </div>
          </div>
        </section>
        
        {/* Previous Key Insights section remains the same */}
      </div>
    </div>
  );
}

export default ExploratoryDataAnalysisPage;
